window.bookSummaryJSON = "<p>The end is nigh. With Gina and Rachel back, Lilith finds herself reminded that relationships are hard, even as she strives to move on with her life and adjusting her newfound confidence. Yet once again she finds herself without time to adjust, as Shadowmind has chosen to make her move at last. Lilith’s maker has no place in her plans for her wayward creation, and the question becomes: What will Lilith choose when faced with Shadowmind’s ultimatum?</p>"; 
